css:
.nuclide-health-pane-item {
  overflow: auto;
}
/* By default, .settings-view uses flex, which messes up table widths in the health pane. */
.nuclide-health-pane-item-section {
  margin-bottom: 3em;
}
.nuclide-health-pane-item-section .settings-view {
  display: block;
}
.nuclide-health-pane-item-section .settings-view .table {
  margin-bottom: 3em;
  table-layout: fixed;
}
.nuclide-health-handle-new {
  color: #f42a2a;
}
.nuclide-health-handle-updated {
  color: #d5880b;
}
.nuclide-health-jewel.tool-bar-btn::after {
  background: rgba(230, 238, 239, 0.5);
  content: attr(data-jewel-value);
  font-size: 0.8em;
  line-height: 1;
  margin-top: 19px;
  padding: 1px;
  position: absolute;
  right: 7px;
}
.nuclide-health-jewel.tool-bar-btn.updated::after {
  color: #d5880b;
}
